   "source": [
    "# --- БЛОК 1: АНАЛИЗ ПРИЗНАКОВ ---\n",
    "library(caret)\n",
    "library(dplyr)\n",
    "library(infotheo) # Для MI\n",
    "library(ggplot2)\n",
    "library(haven)\n",
    "\n",
    "\n",
    "df <- read_sav(\"/kaggle/input/kursovaya/r33i_os_84.sav\") \n",
    "# 1.1 Подготовка и Feature Engineering\n",
    "df_eda <- df %>%\n",
    "  filter(cc_age >= 7 & cc_age < 18) %>% \n",
    "  select(health_score = ccm3, age = cc_age, weight = ccm1, height = ccm2, grades = cck3.5, \n",
    "         class_size = cck3.2, internet = ccj123, has_phone = ccj125.1, screen_limit = cck27, \n",
    "         sport_freq = cck7.5, pe_lessons = cck7.1, friends_meet = cck8.20, hospital_3m = ccl20, \n",
    "         minor_illness = ccl5.1, checkup = ccl26, region, status) %>% \n",
    "  mutate(across(everything(), ~ifelse(. > 9000, NA, .))) %>%\n",
    "  na.omit() %>%\n",
    "  mutate(\n",
    "    bmi = weight / ((height/100)^2),\n",
    "    age_sq = age^2, # Квадраты (просили!)\n",
    "    bmi_sq = bmi^2,\n",
    "    friends_sq = friends_meet^2,\n",
    "    target = factor(ifelse(health_score <= 2, \"Healthy\", \"Not_Healthy\"))\n",
    "  ) %>% select(-health_score)\n",
    "\n",
    "# 1.2 Mutual Information (ИСПРАВЛЕННЫЙ)\n",
    "print(\"Считаем Mutual Information...\")\n",
    "\n",
    "# Дискретизация\n",
    "data_disc <- discretize(df_eda %>% select(-target))\n",
    "target_disc <- df_eda$target\n",
    "\n",
    "# Считаем MI вручную для каждой колонки\n",
    "mi_list <- sapply(data_disc, function(x) mutinformation(target_disc, x))\n",
    "\n",
    "# Собираем датафрейм\n",
    "mi_df <- data.frame(\n",
    "  Feature = names(mi_list), \n",
    "  MI = as.numeric(mi_list)\n",
    ") %>%\n",
    "  arrange(desc(MI))\n",
    "\n",
    "# Рисуем\n",
    "ggplot(mi_df, aes(x = reorder(Feature, MI), y = MI)) +\n",
    "  geom_bar(stat = \"identity\", fill = \"steelblue\") + \n",
    "  coord_flip() +\n",
    "  labs(title = \"Важность признаков (Mutual Info)\", \n",
    "       x = \"Признак\", y = \"Взаимная информация (наты)\")\n",
    "\n",
    "# 1.3 RFE (Требование №3)\n",
    "print(\"Запускаем RFE (Recursive Feature Elimination)...\")\n",
    "ctrl_rfe <- rfeControl(functions = rfFuncs, method = \"cv\", number = 3)\n",
    "# Берем sample, чтобы быстро\n",
    "subsample <- df_eda[sample(nrow(df_eda), min(500, nrow(df_eda))), ] \n",
    "rfe_res <- rfe(subsample %>% select(-target), subsample$target, sizes = c(5, 10, 15), rfeControl = ctrl_rfe)\n",
    "print(rfe_res)\n",
    "plot(rfe_res, type = c(\"g\", \"o\"), main = \"RFE: Сколько признаков нужно?\")"
   ]
  },
