   "source": [
    "# --- БЛОК 2: PCA АНАЛИЗ (ИСПРАВЛЕННЫЙ) ---\n",
    "\n",
    "# 1. Берем числа И убираем константные колонки (где дисперсия = 0)\n",
    "nums <- df_eda %>% \n",
    "  select(where(is.numeric)) %>%\n",
    "  select(where(~ var(.) != 0)) # <--- ВОТ СПАСЕНИЕ\n",
    "\n",
    "# 2. Теперь PCA не упадет\n",
    "pca_res <- prcomp(nums, center = TRUE, scale. = TRUE)\n",
    "\n",
    "# 2.1 Scree Plot\n",
    "var_explained <- pca_res$sdev^2 / sum(pca_res$sdev^2)\n",
    "qplot(c(1:length(var_explained)), var_explained) + \n",
    "  geom_line(color=\"blue\", size=1) + \n",
    "  geom_point(size=2) +\n",
    "  labs(title = \"Scree Plot (Метод локтя)\", \n",
    "       subtitle = \"Сколько компонент нужно?\", \n",
    "       x = \"Номер компоненты\", y = \"Доля объясненной дисперсии\") +\n",
    "  theme_minimal()\n",
    "\n",
    "# 2.2 Визуализация классов\n",
    "pca_data <- as.data.frame(pca_res$x)\n",
    "# Добавляем таргет обратно (он у нас по строкам совпадает)\n",
    "pca_data$Group <- df_eda$target \n",
    "\n",
    "ggplot(pca_data, aes(x=PC1, y=PC2, color=Group)) + \n",
    "  geom_point(alpha=0.6, size=2) +\n",
    "  labs(title = \"PCA: Визуализация пространства признаков\", \n",
    "       subtitle = \"Видно ли разделение классов?\",\n",
    "       color = \"Здоровье\") +\n",
    "  theme_minimal()\n"
   ]
  },
