   "source": [
    "# --- БЛОК 3: МОДЕЛИРОВАНИЕ (ВОЗВРАТ К ИСТОКАМ + ЗАЩИТА) ---\n",
    "\n",
    "library(caret)\n",
    "library(caretEnsemble)\n",
    "library(dplyr)\n",
    "\n",
    "print(\"--- [3/6] Обучение моделей (Stable Version) ---\")\n",
    "\n",
    "# 1. Берем данные как раньше (без ручного One-Hot Encoding, caret сам справится)\n",
    "df_mod <- df %>%\n",
    "  filter(cc_age >= 7 & cc_age < 18) %>% \n",
    "  select(health_score = ccm3, age = cc_age, weight = ccm1, height = ccm2, grades = cck3.5, \n",
    "         class_size = cck3.2, internet = ccj123, has_phone = ccj125.1, screen_limit = cck27, \n",
    "         sport_freq = cck7.5, pe_lessons = cck7.1, friends_meet = cck8.20, hospital_3m = ccl20, \n",
    "         minor_illness = ccl5.1, checkup = ccl26, region, status) %>% \n",
    "  mutate(across(everything(), ~ifelse(. > 9000, NA, .))) %>% \n",
    "  mutate(sport_freq = ifelse(is.na(sport_freq), 0, sport_freq), \n",
    "         friends_meet = ifelse(is.na(friends_meet), 3, friends_meet), \n",
    "         minor_illness = ifelse(is.na(minor_illness), 2, minor_illness)) %>%\n",
    "  mutate(bmi = weight / ((height/100)^2), \n",
    "         age_sq = age^2, \n",
    "         bmi_sq = bmi^2, \n",
    "         friends_sq = friends_meet^2,\n",
    "         target = factor(ifelse(health_score <= 2, \"Healthy\", \"Not_Healthy\"), \n",
    "                         levels = c(\"Healthy\", \"Not_Healthy\"))) %>%\n",
    "  select(-health_score, -bmi) %>% # Убираем лишнее\n",
    "  na.omit()\n",
    "\n",
    "# 2. ЗАЩИТА: Убираем переменные с почти нулевой дисперсией (Near Zero Variance)\n",
    "# Это спасет PCA от падения внутри фолдов\n",
    "nzv <- nearZeroVar(df_mod, saveMetrics = TRUE)\n",
    "if (any(nzv$nzv)) {\n",
    "  print(\"Удаляем почти константные колонки:\")\n",
    "  print(rownames(nzv)[nzv$nzv])\n",
    "  df_mod <- df_mod[, !nzv$nzv]\n",
    "}\n",
    "\n",
    "# 3. Чистим имена колонок (для XGBoost)\n",
    "colnames(df_mod) <- make.names(colnames(df_mod))\n",
    "\n",
    "# 4. Контроль\n",
    "set.seed(123)\n",
    "# Возвращаемся к обычному createFolds (он работал)\n",
    "my_folds <- createFolds(df_mod$target, k = 5) \n",
    "\n",
    "ctrl <- trainControl(\n",
    "  method = \"cv\", \n",
    "  number = 5,\n",
    "  index = my_folds,\n",
    "  savePredictions = \"final\",\n",
    "  classProbs = TRUE,\n",
    "  allowParallel = TRUE\n",
    ")\n",
    "\n",
    "# 5. Зоопарк\n",
    "# continue_on_fail = TRUE позволит нам увидеть выживших\n",
    "model_list <- caretList(\n",
    "  target ~ ., \n",
    "  data = df_mod,\n",
    "  trControl = ctrl,\n",
    "  continue_on_fail = TRUE, \n",
    "  tuneList = list(\n",
    "    # Базовые\n",
    "    xgbTree = caretModelSpec(method = \"xgbTree\", tuneLength = 3, verbosity = 0),\n",
    "    rf      = caretModelSpec(method = \"rf\", tuneLength = 3),\n",
    "    glm     = caretModelSpec(method = \"glm\"),\n",
    "    # PCA версии (они часто падают, но nzv должен помочь)\n",
    "    glm_pca = caretModelSpec(method = \"glm\", preProcess = c(\"center\", \"scale\", \"pca\")),\n",
    "    rf_pca  = caretModelSpec(method = \"rf\",  preProcess = c(\"center\", \"scale\", \"pca\"), tuneLength = 3)\n",
    "  )\n",
    ")\n",
    "\n",
    "# 6. Результаты\n",
    "results <- resamples(model_list)\n",
    "summary(results)\n",
    "dotplot(results, main = \"Сравнение моделей\")\n"
   ]
  },
