    "# ==============================================================================\n",
    "# БЛОК 5: ФИНАЛЬНЫЙ СТЕКИНГ (АНСАМБЛЬ)\n",
    "# ==============================================================================\n",
    "print(\"--- [4/6] Обучение Стекинга ---\")\n",
    "\n",
    "# Мы используем model_list, который успешно обучился в Блоке 3\n",
    "# Но для стекинга нам нужен \"мета-контроль\" с savePredictions=\"final\"\n",
    "\n",
    "# 1. Настройка мета-модели\n",
    "meta_ctrl <- trainControl(\n",
    "  method = \"cv\", \n",
    "  number = 5, \n",
    "  classProbs = TRUE, \n",
    "  savePredictions = \"final\" # Обязательно для ROC\n",
    ")\n",
    "\n",
    "# 2. Сборка ансамбля\n",
    "# Используем все 5 моделей: xgbTree, rf, glm, glm_pca, rf_pca\n",
    "stack_final <- caretStack(\n",
    "  model_list, # Берем список из предыдущего шага\n",
    "  method = \"glm\", \n",
    "  metric = \"Kappa\",\n",
    "  trControl = meta_ctrl\n",
    ")\n",
    "\n",
    "print(stack_final)\n",
    "# Если здесь Accuracy ~0.81-0.82 и Kappa > 0.15 — это успех.\n",
    "\n",
    "# ==============================================================================\n",
    "# БЛОК 6: ЧЕСТНАЯ ВАЛИДАЦИЯ И ВЫБОР ПОРОГА\n",
    "# ==============================================================================\n",
    "print(\"--- [5/6] Анализ порога (Trade-off) ---\")\n",
    "\n",
    "library(pROC)\n",
    "library(ggplot2)\n",
    "library(tidyr)\n",
    "\n",
    "# 1. Извлекаем предсказания (Out-of-Fold)\n",
    "# stack_final$ens_model — это мета-модель (GLM)\n",
    "cv_preds <- stack_final$ens_model$pred\n",
    "\n",
    "# 2. Строим ROC-кривую\n",
    "roc_obj <- roc(response = cv_preds$obs, \n",
    "               predictor = cv_preds$Healthy,\n",
    "               levels = c(\"Not_Healthy\", \"Healthy\"))\n",
    "\n",
    "# 3. Находим лучший порог (автоматически)\n",
    "best_thr <- coords(roc_obj, \"best\", ret = c(\"threshold\", \"specificity\", \"sensitivity\"))\n",
    "\n",
    "print(\"--- РЕЗУЛЬТАТЫ ---\")\n",
    "print(paste(\"AUC:\", round(auc(roc_obj), 4)))\n",
    "print(paste(\"Best Threshold:\", round(best_thr$threshold, 3)))\n",
    "\n",
    "# 4. Данные для графика (Зависимость Sens/Spec от порога)\n",
    "calc_metrics <- function(thresh) {\n",
    "  preds_class <- factor(ifelse(cv_preds$Healthy > thresh, \"Healthy\", \"Not_Healthy\"),\n",
    "                        levels = c(\"Healthy\", \"Not_Healthy\"))\n",
    "  cm <- confusionMatrix(preds_class, cv_preds$obs)\n",
    "  return(c(\n",
    "    Threshold = thresh, \n",
    "    Find_Healthy = as.numeric(cm$byClass['Sensitivity']), \n",
    "    Find_Sick    = as.numeric(cm$byClass['Specificity'])\n",
    "  ))\n",
    "}\n",
    "\n",
    "thresholds <- seq(0.1, 0.95, by = 0.05)\n",
    "res_df <- as.data.frame(t(sapply(thresholds, calc_metrics)))\n",
    "res_long <- pivot_longer(res_df, cols = c(\"Find_Healthy\", \"Find_Sick\"), names_to = \"Metric\", values_to = \"Value\")\n",
    "\n",
    "# 5. ГРАФИК (Final Plot)\n",
    "ggplot(res_long, aes(x = Threshold, y = Value, color = Metric)) +\n",
    "  geom_line(linewidth = 1.2) + \n",
    "  geom_point(size = 3) +\n",
    "  geom_vline(xintercept = best_thr$threshold, linetype=\"dashed\", color=\"black\") +\n",
    "  annotate(\"text\", x = best_thr$threshold + 0.05, y = 0.5, \n",
    "           label = paste(\"Optimum:\", round(best_thr$threshold, 2)), color = \"black\") +\n",
    "  scale_color_manual(values = c(\"Find_Healthy\" = \"forestgreen\", \"Find_Sick\" = \"red2\"),\n",
    "                     labels = c(\"Чувствительность (Здоровые)\", \"Специфичность (Больные)\")) +\n",
    "  labs(title = \"Баланс точности: Выбор порога принятия решений\",\n",
    "       subtitle = paste0(\"При пороге \", round(best_thr$threshold, 2), \n",
    "                         \" модель находит \", round(best_thr$specificity*100), \"% больных\"),\n",
    "       y = \"Доля верных ответов\", x = \"Порог вероятности 'Здоров'\") +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"bottom\")\n"
   ]
  },
