    "# ==============================================================================\n",
    "# БЛОК 7: ДЕТАЛЬНОЕ СРАВНЕНИЕ МОДЕЛЕЙ (ДЛЯ КУРСОВОЙ)\n",
    "# ==============================================================================\n",
    "\n",
    "library(caret)\n",
    "library(dplyr)\n",
    "\n",
    "print(\"--- ДЕТАЛЬНОЕ СРАВНЕНИЕ ВСЕХ МОДЕЛЕЙ ---\")\n",
    "\n",
    "# Функция для расчета всех метрик по одной модели\n",
    "get_full_metrics <- function(model, model_name, data) {\n",
    "  \n",
    "  preds <- predict(model, newdata = data)\n",
    "  probs <- predict(model, newdata = data, type = \"prob\")\n",
    "  \n",
    "  cm <- confusionMatrix(preds, data$target)\n",
    "  \n",
    "  # Извлекаем метрики\n",
    "  acc  <- cm$overall['Accuracy']\n",
    "  kap  <- cm$overall['Kappa']\n",
    "  sens <- cm$byClass['Sensitivity']  # Recall для Healthy\n",
    "  spec <- cm$byClass['Specificity']  # Recall для Not_Healthy\n",
    "  ppv  <- cm$byClass['Pos Pred Value'] # Precision для Healthy\n",
    "  npv  <- cm$byClass['Neg Pred Value'] # Precision для Not_Healthy\n",
    "  f1   <- cm$byClass['F1']\n",
    "  \n",
    "  # Собираем в строку\n",
    "  data.frame(\n",
    "    Model = model_name,\n",
    "    Accuracy = round(acc, 4),\n",
    "    Kappa = round(kap, 4),\n",
    "    Sensitivity = round(sens, 4),  # Находим здоровых\n",
    "    Specificity = round(spec, 4),  # Находим больных\n",
    "    Precision = round(ppv, 4),\n",
    "    F1 = round(f1, 4),\n",
    "    row.names = NULL\n",
    "  )\n",
    "}\n",
    "\n",
    "# Собираем метрики по всем моделям из model_list\n",
    "metrics_table <- bind_rows(\n",
    "  get_full_metrics(model_list$xgbTree, \"XGBoost\", df_mod),\n",
    "  get_full_metrics(model_list$rf,      \"Random Forest\", df_mod),\n",
    "  get_full_metrics(model_list$glm,     \"GLM (Logistic)\", df_mod),\n",
    "  get_full_metrics(model_list$glm_pca, \"GLM + PCA\", df_mod),\n",
    "  get_full_metrics(model_list$rf_pca,  \"RF + PCA\", df_mod)\n",
    ")\n",
    "\n",
    "# Добавляем Стекинг\n",
    "metrics_table <- bind_rows(\n",
    "  metrics_table,\n",
    "  get_full_metrics(stack_final, \"Stacking (Ensemble)\", df_mod)\n",
    ")\n",
    "\n",
    "print(\"=== ТАБЛИЦА СРАВНЕНИЯ (6 метрик) ===\")\n",
    "print(metrics_table)\n"
   ]
