    "# ==============================================================================\n",
    "# БЛОК 8: МАТРИЦЫ ОШИБОК ДЛЯ ВСЕХ МОДЕЛЕЙ\n",
    "# ==============================================================================\n",
    "\n",
    "print(\"=== МАТРИЦЫ ОШИБОК ===\")\n",
    "\n",
    "# Функция для красивого вывода матрицы\n",
    "print_confusion <- function(model, model_name, data) {\n",
    "  preds <- predict(model, newdata = data)\n",
    "  cm <- confusionMatrix(preds, data$target)\n",
    "  \n",
    "  cat(\"\\n\")\n",
    "  cat(\"=====================================\\n\")\n",
    "  cat(paste(\"МОДЕЛЬ:\", model_name, \"\\n\"))\n",
    "  cat(\"=====================================\\n\")\n",
    "  print(cm$table)\n",
    "  cat(paste(\"Accuracy:\", round(cm$overall['Accuracy'], 4), \"\\n\"))\n",
    "  cat(paste(\"Kappa:   \", round(cm$overall['Kappa'], 4), \"\\n\"))\n",
    "  cat(paste(\"Sens (Healthy):    \", round(cm$byClass['Sensitivity'], 4), \"\\n\"))\n",
    "  cat(paste(\"Spec (Not_Healthy):\", round(cm$byClass['Specificity'], 4), \"\\n\"))\n",
    "  cat(\"\\n\")\n",
    "}\n",
    "\n",
    "# Выводим для каждой модели\n",
    "print_confusion(model_list$xgbTree, \"XGBoost\", df_mod)\n",
    "print_confusion(model_list$rf,      \"Random Forest\", df_mod)\n",
    "print_confusion(model_list$glm,     \"GLM (Logistic)\", df_mod)\n",
    "print_confusion(model_list$glm_pca, \"GLM + PCA\", df_mod)\n",
    "print_confusion(model_list$rf_pca,  \"RF + PCA\", df_mod)\n",
    "print_confusion(stack_final,        \"STACKING (Final)\", df_mod)\n"
   ]
