    "# ==============================================================================\n",
    "# БЛОК 9: SMOTE ЭКСПЕРИМЕНТ (ДЛЯ РАЗДЕЛА \"ЧТО НЕ СРАБОТАЛО\")\n",
    "# ==============================================================================\n",
    "\n",
    "print(\"--- ЭКСПЕРИМЕНТ: SMOTE ---\")\n",
    "\n",
    "# Контроль с балансировкой (up безопаснее, чем smote)\n",
    "ctrl_smote <- trainControl(\n",
    "  method = \"cv\", \n",
    "  number = 5, \n",
    "  sampling = \"up\", # Можно \"smote\", если установлен пакет\n",
    "  classProbs = TRUE, \n",
    "  savePredictions = \"final\"\n",
    ")\n",
    "\n",
    "# Обучаем RF с SMOTE\n",
    "set.seed(123)\n",
    "model_smote <- train(\n",
    "  target ~ ., \n",
    "  data = df_mod, \n",
    "  method = \"rf\", \n",
    "  trControl = ctrl_smote,\n",
    "  tuneLength = 3\n",
    ")\n",
    "\n",
    "# Матрица ошибок SMOTE (на train — чтобы показать переобучение)\n",
    "print(\"--- SMOTE: Матрица на обучающей выборке (показывает переобучение) ---\")\n",
    "preds_smote_train <- predict(model_smote, newdata = df_mod)\n",
    "cm_smote_train <- confusionMatrix(preds_smote_train, df_mod$target)\n",
    "print(cm_smote_train$table)\n",
    "print(paste(\"Accuracy (Train):\", round(cm_smote_train$overall['Accuracy'], 4)))\n",
    "print(paste(\"Spec (Train):    \", round(cm_smote_train$byClass['Specificity'], 4)))\n",
    "\n",
    "# Честные метрики SMOTE (из CV)\n",
    "print(\"--- SMOTE: Честные метрики (Cross-Validation) ---\")\n",
    "smote_cv_preds <- model_smote$pred\n",
    "cm_smote_cv <- confusionMatrix(smote_cv_preds$pred, smote_cv_preds$obs)\n",
    "print(cm_smote_cv$table)\n",
    "print(paste(\"Accuracy (CV):\", round(cm_smote_cv$overall['Accuracy'], 4)))\n",
    "print(paste(\"Spec (CV):    \", round(cm_smote_cv$byClass['Specificity'], 4)))\n",
    "\n",
    "print(\"ВЫВОД: SMOTE дает переобучение. На train Spec высокая, на CV — низкая.\")\n"
   ]
